if mibBuilder.loadTexts: wgIpsecEndpointPairModule.setDescription("The MIB module describes generic Ipsec Endpoint Pair information of WatchGuard system. Mainly, the information obtained from this MIB is used to constructed topological view of IPSec security gateways that are connected by IPSec tunnels. An IPSec Endpoint Pair is a pair of security gateways that are connected with 0 or more IPSec SA's in tunnel mode. It contains information of aggregated information of tunnel mode SA's between two security gateways. An IPSec Endpoint Pair is identified by a pair of IP addresses. Therefore, if an IPSec security gateway X has 2 external IP addresses while IPsec secruity gateway Y has 3 external IP addresses, there are potentially 6 IPsec Endpoint Pairs between X and Y.")
